.text
# a orientao tomada no projeto tem como origem 
#o vertice superior esquerdo

main: 	addi $23 $0 0 # carga do canhao => com 7 ele atira
	addi $24 $0 3 # vida do personagem
	addi $25 $0 6 # vida do robo
	addi $18 $0 12 # a qantidade de movimentaes que o personagem pode ter

# informaes do protagonista
	lui $21 0x1001
	addi $21 $21 23652
	addi $16 $0 0xd7ac88
# informaes do protagonista

# informaes do robo
	addi $17 $0 0x1cf6f7 # luz canhao
# informaes do robo
	jal cenario
	lui $12 0xffff # endereo da verificao de tecla pressionada
stand_by: bne $0 $0 fim
	lw $11 0($12) # carrega o estado do keyboard
	beq $11 $0 stand_by
	lw $11 4($12) # carrega o estado do keyboard
	addi $14 $0 'c'
	beq $14 $11 start_jogo
	j stand_by

start_jogo: jal carregar_robo

rodando_o_jogo: beq $24 $0 desintegra_pj
	beq $25 $0 caveira_destruida
	lui $12 0xffff # endereo da verificao de tecla pressionada 
	blt $23 20 movimentao
	jal tiro_canhao
	jal time_lapse1
# checa se foi digitada alguma tecla
movimentao:
	lw $11 0($12)
	beq $11 $0 carga_do_canhao
# o pj s ir atirar quando o robo no tiver disparando
# e quando estiver em p
	addi $14 $0 'f'
	lw $11 4($12)
	bne $11 $14 qual_movimento
	jal atirar
qual_movimento:jal checa_tecla
carga_do_canhao:addi $23 $23 1 # +1 carga do canho
	j rodando_o_jogo
 
fim: addi $2 $0 10
	syscall
	
## ============== FUNES ==============  ##
fimTimer: 
volta: jr $31

# ==========	Timers
time_lapse1: addi $20 $0 80000
fortl: beq $20 $0 fimTimer
	nop
	addi $20 $20 -1
	j fortl

timer_jogo:addi $20 $0 80000
fort2: beq $20 $0 fimTimer
	nop
	addi $20 $20 -1
	j fort2
timer_canhao: addi $20 $0 10000
fort3: beq $20 $0 fimTimer
	nop
	addi $20 $20 -1
	j fort3
	
timer_avanar: addi $20 $0 1000
fort5: beq $20 $0 fimTimer
	nop
	addi $20 $20 -1
	j fort5

# ========== AO
# posio inicial do disparo do canhao 
# 60 linhas, 103 colunas
# vai se deslocar 105 vezes para a esquerda
# desenho da munio
#	  _ _ _
#	 |_|_|_|
#	 |_|_|_| 
tiro_canhao: 
	lui $13 0x1001 
	addi $13 $13 25508 
	addi $17 $0 0x1cf6f7  
	addi $8 $0 104
	add $9 $0 $31
# posio da energia do canho do robo
	
movimento_canhao: beq $8 $0 carregar_novo_tiro
# checar se alguma tecla foi digitada
	lw $11 0($12)
	beq $11 $0 checa_se_acertou_o_pj
	jal checa_tecla
checa_se_acertou_o_pj:
	lw $11 -8($13)
	bne $11 $16 sem_ao
#acertou o pj
	addi $24 $24 -1
	j carregar_novo_tiro
sem_ao:
# px de cima
	sw $17 -8($13)
	sw $17 -4($13)
	sw $17 0($13)
# px de baixo
	sw $17 512($13)
	sw $17 508($13) 
	sw $17 504($13) 
# tempo de movimentao
	jal timer_canhao
# nessa parte se carrega os px da shadow e sobrescreve o disparo	
	lw $11 32760($13)
	sw $11 -8($13)
	lw $11 32764($13)
	sw $11 -4($13)
	lw $11 32768($13)
	sw $11 0($13)
	lw $11 33280($13)
	sw $11 512($13)
	lw $11 33276($13)
	sw $11 508($13)
	lw $11 33272($13)
	sw $11 504($13)
	addi $8 $8 -1
	addi $13 $13 -4
	j movimento_canhao
carregar_novo_tiro: 
	# volta para rodando_o_jogo
	add $31 $0 $9
	j volta 

#===========	Descarrega canhao 
# funo que carrega a shadow por sobre a energia do canhao
# dando o feito da arma do robo estar descarregada
	

# ==========	Movimentao do personagem
checa_tecla:  add $22 $0 $31 # volta para quem chamou
	lw $11 4($12)
	beq $19 1 no_abaixa
	beq $18 50 no_avana
	addi $14 $0 'd'
	beq $11 $14 avanar
	
no_avana: 
	beq $18 $0 no_recua
	addi $14 $0 'a'
	beq $11 $14 recuar
no_recua: 
	addi $14 $0 's'
	beq $11 $14 se_abaixe
no_abaixa: beq $19 $0 no_levanta	
	addi $14 $0 'w'
	beq $11 $14 levantar
	
no_levanta:add $31 $0 $22
	j volta

# apago o personagem, linha a linha, na sua atual posio
avanar:jal load_pj
	addi $21 $21 8
	jal timer_avanar
	jal faz_pj
	addi $18 $18 1
fim_avanar:add $31 $0 $22
	j volta
	
recuar: jal load_pj
	addi $21 $21 -8
	jal timer_avanar
	jal faz_pj
	addi $18 $18 -1
fim_recuar: add $31 $0 $22
	j volta

# abaixar para se proteger do canhao
se_abaixe: jal load_pj
	addi $15 $0 5
	addi $21 $21 3072
loop_abaixado: beq $15 $0 pes_abaixado
	bne $15 3 tronco_abaixado
	addi $14 $0 0xbfbdcb # cor da arma
	sw $14 8($21)
	sw $14 12($21)
	sw $14 16($21)
tronco_abaixado:sw $16 4($21)
	sw $16 0($21)
	addi $21 $21 512
	addi $15 $15 -1	 
	j loop_abaixado
pes_abaixado: 
	sw $16 0($21)
	sw $16 -4($21)
	sw $16 -504($21)
	sw $16 8($21)
encerra_abaixado:
	add $31 $0 $22
	addi $19 $0 1
	j volta	
levantar: addi $15 $0 11
loop_levantar: beq $15 $0 em_pe
	lw $11 32764($21)
	sw $11 -4($21)
	lw $11 32768($21)
	sw $11 0($21)
	lw $11 32772($21)
	sw $11 4($21)
	lw $11 32776($21)
	sw $11 8($21)
	lw $11 32780($21)
	sw $11 12($21)
	lw $11 32784($21)
	sw $11 16($21)
	lw $11 32788($21)
	sw $11 20($21)
	addi $21 $21 -512
	addi $15 $15 -1 
	j loop_levantar
em_pe: jal faz_pj
	add $31 $0 $22
	j volta 

# ========== Disparo do PJ
# a ideia  pegar a posio centro do pj ($21) e printar/load nas posies
# 2072 e 2076, avanando de coluna em coluna at se chocar contra o canhao 
atirar: bne $19 $0 volta # s atira quando tiver em p
	addi $14 $0 0xbfbdcb # cor da munio
	addi $8 $0 0
	add $9 $0 $31
# SOM DO DISPARO
	addi $4 $0 48     # pitch (nota MIDI)
	addi $5 $0 800      # durao em milissegundos
	addi $6 $0 127       # instrumento (patch MIDI)
	addi $7 $0 100
	addi $2 $0 31       # Cdigo de servio 31
	syscall
	
loop_atirar: bne $0 $0 fim 
	lw $11 3104($21)
	bne $14 $11 no_acertou
# se acertou, faz o som do impacto e volta 
# para rodando_o_jogo
	addi $4 $0 69
	addi $6 $0 127 
	syscall
	addi $25 $25 -1
	add $21 $21 $8
	add $31 $0 $9
	j volta
no_acertou:
	sw $14 3096($21)
	sw $14 3100($21)
	jal timer_canhao
	lw $11 35864($21)
	sw $11 3096($21)
	lw $11 32868($21)
	sw $11 3100($21)
	addi $21 $21 4
# qnt de movimentos da munio
	addi $8 $8 -4
	j loop_atirar

# funo para atirar enquanto o canhao atira tambm

	
# ========== ESTTICO		
# esse rotulo s  acessado uma vez, pois
# define a origem do protagonista na tela
# e $21 ir guardar a posio onde ele estar
faz_pj:
	addi $15 $0 10
loop_pj: beq $15 $0 pes
	sw $16 0($21)
	beq $15 8 pescoo
	sw $16 4($21)
	beq $15 5 cano_arma # cria o cano da arma
	beq $15 4 cano_arma # cria o cano da arma
pescoo:addi $21 $21 512
	addi $15 $15 -1	 
	j loop_pj
cano_arma:	addi $14 $0 0xbfbdcb
	sw $14 8($21)
	sw $14 12($21)
	beq $15 4 pescoo # cria o cano da arma
	sw $14 16($21)
	sw $14 20($21)
	j pescoo
pes: sw $16 0($21)
	sw $16 -4($21)
	sw $16 508($21)
	sw $16 4($21)
	sw $16 516($21)
	sw $16 520($21)
