time_desintegra: addi $20 $0 20000
loop_timer_desin: beq $20 $0 volta
	nop
	addi $20 $20 -1
	j loop_timer_desin
desintegra_pj:
	addi $21 $21 512
	addi $10 $0 6
# a energia consome o tronco 
# de cima para baixo
desintegra_pt1: 
	beq $10 $0 desintegra_pt2
	jal time_desintegra
	sw $17 0($21)
	sw $17 516($21)
	addi $21 $21 1024
	addi $10 $10 -1
	jal time_desintegra
	syscall
	j desintegra_pt1
# a energia os ps	
desintegra_pt2: addi $21 $21 -1020
	sw $17 516($21)
	sw $17 -8($21)
	sw $17 504($21)
# a energia faz o caminho contrrio
desintegra_pt3: addi $10 $0 4
loop_pt3: beq $10 $0 desintegra_pt4
	jal time_desintegra
	sw $17 0($21)
	sw $17 508($21)
	jal time_desintegra
	addi $10 $10 -1
	addi $21 $21 -1024
	j loop_pt3
# a energia toma de conta do pj
desintegra_pt4:
	sw $17 508($21)
	jal time_desintegra
	sw $17 -516($21)
	jal time_desintegra
	sw $17 -1024($21)
	jal time_desintegra

# volta ao px de centro do pj
	addi $21 $21 -1028
